import { Layout  } from 'antd';
import Header from './header';
import Footer from './footer';
import Carousel from '../components/carousel';
import Card from '../components/card';

const { Content } = Layout;
const Index = (props) => {
  return(
    <Layout>
    <Header />
    <Content>
      <Carousel/>
      <Card/>
      
    </Content>
    <Footer />
  </Layout> 
  )
}


export default Index;
